    return (
        <div className="App">
            <h1>Backlink Checker</h1>
            <input 
                type="text" 
                value={target}
                onChange={(e) => setUrl(e.target.value)}
                placeholder="Enter URL"
                className="form-control"
            />
            <button onClick={fetchBacklinks} className="btn btn-primary my-3">Check Backlinks</button>
            
            {backlinks.length > 0 && (
                <table className="table table-striped table-bordered">
                    <thead className="table-dark">
                        <tr>
                            <th>URL From</th>
                            <th>URL To</th>
                            <th>Title</th>
                            <th>Anchor Text</th>
                            <th>ALT</th>
                            <th>No-Follow</th>
                            <th>Image</th>
                            <th>Image Source</th>
                            <th>Inlink Rank</th>
                            <th>Domain Inlink Rank</th>
                            <th>First Seen</th>
                            <th>Last Visited</th>
                        </tr>
                    </thead>
                    <tbody>
                        {backlinks.map((backlink, index) => (
                            <tr key={index}>
                                <td>{backlink.url_from}</td>
                                <td>{backlink.url_to}</td>
                                <td>{backlink.title}</td>
                                <td>{backlink.anchor_text}</td>
                                <td>{backlink.alt}</td>
                                <td>{backlink.nofollow ? "Yes" : "No"}</td>
                                <td>{backlink.image ? "Yes" : "No"}</td>
                                <td>{backlink.image_source}</td>
                                <td>{backlink.inlink_rank}</td>
                                <td>{backlink.domain_inlink_rank}</td>
                                <td>{backlink.first_seen}</td>
                                <td>{backlink.last_visited}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
    
}

export default App;
